import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

function Header({ isLoggedIn, openRegistrationPopup, openSignInPopup }) {
  return (
    <header className="header d-flex justify-content-between align-items-center px-4">
      <div className="logo-wrapper">
        <div className="logo"><Link to="/">Elevate</Link></div>
      </div>
      {isLoggedIn ? (
        <div className="logged-in-header d-flex justify-content-between align-items-center">
          <button className="wallet-button btn me-3">Wallet</button>
          <div className="profile-icon">
            <img src="/path/to/profile-icon.svg" alt="Profile" />
          </div>
        </div>
      ) : (
        <div className="auth-buttons">
          <button className="login-button btn me-3" onClick={openSignInPopup}>Login</button>
          <button className="register-button btn" onClick={openRegistrationPopup}>Register</button>
        </div>
      )}
    </header>
  );
}

export default Header;
